          //void slotDestroyed(QObject* obj) {
          //  qDebug() << "destroying QObject:" << (long int)obj;
          //}

        

        private:
        // wrapped object:
        RSolidEntity* wrapped;

        
          // wrapped object as shared pointer:
          QSharedPointer<RSolidEntity> spWrapped;
        

        bool wrappedCreated;
      
